4432	\N	\N	3226	'1':141 '1896':137 '1897':46,96 '1951':81 '1954':70 '1973':109,130 '1974':124 '1988':55 '1994':31 '1997':83 '2000':22,85 '2013':116 '2021':143 'a':10 'academy':16,68,186 'among':40 'ancient':7 'and':71,84,97,131,153,157,180 'antike':120 'antiken':104 'antiquarian':87 'antiquorum':78 'archaeological':160 'archaeology':155,179 'archäologie':26,51 'at':13,183 'austrian':15,159,185 'balkan':92 'balkan-kommission':91 'been':62,146 'between':82 'classical':181 'corpus':76,102 'created':29 'culture':8 'das':75,101 'department':88 'der':103 'emerged':20,53 'ephesos':59 'european':154 'field':177 'finally':114 'focuses':170 'for':3,151 'forschungsstelle':25 'foundational':173 'founded':44,79,94,107,122,128,135 'from':23,56 'für':49,74,100,119 'had':61 'has':145 'ikant':9,113,144 'in':21,30,45,54,80,95,108,115,123,129,136,175 'include':39 'incorporated':111,139 'institute':2,12,150,161,169 'into':112 'january':142 'kleinasiatische':133 'kleinasiens':106 'kommission':48,73,93,99,118,127,134 'kommissionen':37 'limeskommission':43 'merged':147 'merger':34 'mosaiken':105 'name':165 'new':168 'numismatische':126 'oeai':162,166 'oeaw':19,189 'of':6,17,35,66,89,178,187 'on':140,171 'orea':156 'oriental':152 'others':41 'patronage':65 'praktische':50 'rechtsgeschichte':121 'research':11,174 'sciences':18,188 'several':36 'since':69 'studies':182 'study':5 'the':1,4,14,24,33,42,47,57,64,67,72,86,90,98,117,125,132,149,158,164,167,172,176,184 'these':38 'through':32 'under':63,163 'unternehmen':58 'vasorum':77 'was':28 'were':110,138 'which':27,52,60 'with':148	The Institute for the Study of Ancient Culture (IKAnt), a research institute at the Austrian Academy of Sciences (OeAW), emerged in 2000 from the „Forschungsstelle Archäologie“, which was created in 1994 through the merger of several „Kommissionen“. These include among others the „Limeskommission“ (founded in 1897), the „Kommission für Praktische Archäologie“ (which emerged in 1988 from the „Unternehmen Ephesos“, which had been under the patronage of the Academy since 1954) and the „Kommission für das Corpus Vasorum Antiquorum“ (founded in 1951). Between 1997 and 2000, the Antiquarian Department of the „Balkan-Kommission“ (founded in 1897) and the „Kommission für das Corpus der antiken Mosaiken Kleinasiens“ (founded in 1973) were incorporated into IKAnt. Finally, in 2013, the „Kommission für Antike Rechtsgeschichte“ (founded in 1974), the „Numismatische Kommission“ (founded in 1973) and the „Kleinasiatische Kommission“ (founded in 1896) were incorporated.\nOn 1 January 2021, IKAnt has been merged with the Institute for Oriental and European Archaeology (OREA) and the Austrian Archaeological Institute (OeAI). Under the name OeAI, the new institute focuses on the foundational research in the field of archaeology and classical studies at the Austrian Academy of Sciences (OeAW).
