4433	\N	\N	3227	'1':124 '1896':122 '1897':41,85 '1951':71 '1954':55 '1973':97,116 '1974':111 '1988':47 '1994':27 '1997':73 '2000':20,75 '2013':101 '2021':126 'a':37 'abteilung':79 'akademie':13,60,165 'altertumswissenschaften':161 'an':10,162 'antike':6,108 'antiken':93 'antiquarische':78 'antiquorum':69 'archäologie':24,46,136,159 'archäologischen':141 'auf':155 'aus':21,49 'balkan':82 'balkan-kommission':81 'bezeichnung':147 'bündelt':149 'corpus':67,91 'das':1,53,66,90,150 'dem':50,130,139,156 'den':29 'der':5,11,14,22,57,59,80,92,105,112,118,146,158,163,166 'die':26,38,42,63,77,87,153 'durch':28 'eine':8 'eingegliedert':100 'eingliederung':104 'entstanden':34 'ephesos':52 'erfolgte':103 'europäische':135 'forschungseinrichtung':9 'forschungsstelle':23 'fusioniert':144 'für':3,44,65,89,107,132 'gebiet':157 'gegr':70,84,96,110,115,121 'gegründet':40 'ging':17 'grundlagenforschung':154 'hervor':25 'hervorgegangen':48 'ikant':7,99,128 'im':18 'ins':98 'institut':2,131,142,152 'jahre':19 'jänner':125 'kleinasiatischen':119 'kleinasiens':95 'kommission':43,64,83,88,106,114,120 'kommissionen':33 'kulturgeschichte':4 'limeskommission':39 'mehrerer':31 'mit':123,129 'mosaiken':94 'neue':151 'numismatischen':113 'orea':137 'orientalische':133 'patronanz':58 'praktische':45 'rechtsgeschichte':109 'schließlich':102 'seit':54 'stand':61 'u':36 'und':62,74,86,117,134,138,160 'unter':56,145 'unternehmen':51 'vasorum':68 'war':35 'wissenschaften':15,167 'wurde':76,127 'zusammenschluss':30 'zwischen':72 'öai':143,148 'öaw':16,32,168 'österreichischen':12,140,164	Das Institut für Kulturgeschichte der Antike (IKAnt), eine Forschungseinrichtung an der Österreichischen Akademie der Wissenschaften (ÖAW), ging im Jahre 2000 aus der Forschungsstelle Archäologie hervor, die 1994 durch den Zusammenschluss mehrerer ÖAW Kommissionen entstanden war: u. a. die Limeskommission (gegründet 1897), die Kommission für Praktische Archäologie (1988 hervorgegangen aus dem Unternehmen Ephesos, das seit 1954 unter der Patronanz der Akademie stand) und die Kommission für das Corpus Vasorum Antiquorum (gegr. 1951). Zwischen 1997 und 2000 wurde die Antiquarische Abteilung der Balkan-Kommission (gegr. 1897) und die Kommission für das Corpus der antiken Mosaiken Kleinasiens (gegr. 1973) ins IKAnt eingegliedert. 2013 schließlich erfolgte Eingliederung der Kommission für Antike Rechtsgeschichte (gegr. 1974), der Numismatischen Kommission (gegr. 1973) und der Kleinasiatischen Kommission (gegr. 1896).\nMit 1. Jänner 2021 wurde IKAnt mit dem Institut für Orientalische und Europäische Archäologie (OREA) und dem Österreichischen Archäologischen Institut (ÖAI) fusioniert. Unter der Bezeichnung ÖAI bündelt das neue Institut die Grundlagenforschung auf dem Gebiet der Archäologie und Altertumswissenschaften an der Österreichischen Akademie der Wissenschaften (ÖAW).
