7	1	https://vocabs.acdh.oeaw.ac.at/schema#hasDescription	http://www.w3.org/1999/02/22-rdf-syntax-ns#langString	en	\N	\N	This collection includes all releases of the metadata schema used to describe resources stored in ARCHE starting with version 1.0. The schema is represented by means of the Web Ontology Language (OWL) and serialised as RDF/XML.\nThe ontology files are stored on GitHub (https://github.com/acdh-oeaw/arche-schema). Each release is represented as an individual resource at the top level of this collection. Each newer release is linked to its immediate predecessor by means of the property 'acdh:isNewVersionOf'. The collection is to be considered open-ended since newer releases of the ontology will be included over time.
