286	71	http://www.w3.org/2000/01/rdf-schema#comment	http://www.w3.org/1999/02/22-rdf-syntax-ns#langString	de	\N	\N	Gibt die Bezeichnung an, die verwendet werden soll, wenn die inverse Relation einer Eigenschaft angezeigt wird, z.B. um die Anzeige der inversen Relation 'setzt fort' als 'wird fortgesetzt durch' zu ermöglichen. Das Vorhandensein dieser Annotation bedeutet, dass solche inversen Relationen angezeigt werden sollen und, wenn eine GUI die Datenbearbeitung gestattet, dem Nutzer die Eingabe von Daten für beide Fälle ermöglicht. Im Hintergrund wird die als Subjekt des inversen Eigenschaft-Tripels bereitgestellte Ressource als ein Objekt des ursprünglichen Eigenschafts-Tripels gespeichert.
287	71	http://www.w3.org/2000/01/rdf-schema#comment	http://www.w3.org/1999/02/22-rdf-syntax-ns#langString	en	\N	\N	Indicates a property label which should be used when displaying the inverse relation of the property, e.g. to allow to display the inverse of 'continues' as 'is continued by'. The presence of this annotation property means that such "inverse relations" should be displayed and if a GUI allows data modification, it should allow the user to input data for both. In the background the resource provided as a subject of the inverse property triple will be stored as an object of the original property triple.
