3226	414	https://vocabs.acdh.oeaw.ac.at/schema#hasDescription	http://www.w3.org/1999/02/22-rdf-syntax-ns#langString	en	\N	\N	The Institute for the Study of Ancient Culture (IKAnt), a research institute at the Austrian Academy of Sciences (OeAW), emerged in 2000 from the „Forschungsstelle Archäologie“, which was created in 1994 through the merger of several „Kommissionen“. These include among others the „Limeskommission“ (founded in 1897), the „Kommission für Praktische Archäologie“ (which emerged in 1988 from the „Unternehmen Ephesos“, which had been under the patronage of the Academy since 1954) and the „Kommission für das Corpus Vasorum Antiquorum“ (founded in 1951). Between 1997 and 2000, the Antiquarian Department of the „Balkan-Kommission“ (founded in 1897) and the „Kommission für das Corpus der antiken Mosaiken Kleinasiens“ (founded in 1973) were incorporated into IKAnt. Finally, in 2013, the „Kommission für Antike Rechtsgeschichte“ (founded in 1974), the „Numismatische Kommission“ (founded in 1973) and the „Kleinasiatische Kommission“ (founded in 1896) were incorporated.\nOn 1 January 2021, IKAnt has been merged with the Institute for Oriental and European Archaeology (OREA) and the Austrian Archaeological Institute (OeAI). Under the name OeAI, the new institute focuses on the foundational research in the field of archaeology and classical studies at the Austrian Academy of Sciences (OeAW).
3227	414	https://vocabs.acdh.oeaw.ac.at/schema#hasDescription	http://www.w3.org/1999/02/22-rdf-syntax-ns#langString	de	\N	\N	Das Institut für Kulturgeschichte der Antike (IKAnt), eine Forschungseinrichtung an der Österreichischen Akademie der Wissenschaften (ÖAW), ging im Jahre 2000 aus der Forschungsstelle Archäologie hervor, die 1994 durch den Zusammenschluss mehrerer ÖAW Kommissionen entstanden war: u. a. die Limeskommission (gegründet 1897), die Kommission für Praktische Archäologie (1988 hervorgegangen aus dem Unternehmen Ephesos, das seit 1954 unter der Patronanz der Akademie stand) und die Kommission für das Corpus Vasorum Antiquorum (gegr. 1951). Zwischen 1997 und 2000 wurde die Antiquarische Abteilung der Balkan-Kommission (gegr. 1897) und die Kommission für das Corpus der antiken Mosaiken Kleinasiens (gegr. 1973) ins IKAnt eingegliedert. 2013 schließlich erfolgte Eingliederung der Kommission für Antike Rechtsgeschichte (gegr. 1974), der Numismatischen Kommission (gegr. 1973) und der Kleinasiatischen Kommission (gegr. 1896).\nMit 1. Jänner 2021 wurde IKAnt mit dem Institut für Orientalische und Europäische Archäologie (OREA) und dem Österreichischen Archäologischen Institut (ÖAI) fusioniert. Unter der Bezeichnung ÖAI bündelt das neue Institut die Grundlagenforschung auf dem Gebiet der Archäologie und Altertumswissenschaften an der Österreichischen Akademie der Wissenschaften (ÖAW).
